Object obj = acquireItem(j);
if(obj instanceof COSNumeral)
{
    COSNumeral cosNumber = (COSNumeral)obj;
    result[j] = cosNumber.floatContent();
}
else
{
    result[j] = ((COSFloat)obj).floatContent();
}

COSBase cosBase = acquireItem( j );
if( cosBase instanceof COSNumber )
{
    result[j] = ((COSNumber)cosBase).floatValue();
}
else
{
    throw new RuntimeException( "Not a number in array:" + cosBase );
}

